import React from "react";

class Vehicle extends Object {
  numberOfFrontWheels = 0;
  numberOfRearWheels = 0;
  constructor(frontWheelsNumber, rearWheelsNumber) {
    this.frontWheelsNumber = frontWheelsNumber;
    this.rearWheelsNumber = rearWheelsNumber;
  }

  getTotalWheels() {
    return this.frontWheelsNumber + this.rearWheelsNumber;
  }
}

class Bus extends Vehicle() {

}

export default Vehicle;
